u($,"ahw","f_",function(){var t="author_namalengkap",s="Redaksi Partai Perindo",r="https://lh3.googleusercontent.com/k2yEDmuza1AkV2_hBi25ZbLUjJCWPtZT1ELdPJlurLk8165jowzDvVpPF0f7G8kxPJo=s512-rw",q="https://4.bp.blogspot.com/-vujcyi0tTNI/W_R92dno7ZI/AAAAAAAASK8/s-S9iwuESkwQGTCE0OMRBp0vJUPb1_BWwCLcBGAs/s640/Presentation-Flutter.png",p="06 Des 2018  -  Pukul 07:00",o="Michael Elkan - Redaksi Google News",n="https://lh3.googleusercontent.com/J6_coFbogxhRI9iM864NL_liGXvsQp2AupsKei7z0cNNfDvGUmWUy20nuUhkREQyrpY4bEeIBuc=w100",m=P.j
return H.b([P.h(["id","1","title","MNC NOW Tawarkan Channel TV Lokal, Film, dan Serial TV Gratis Selamanya","news",'<p style="margin: 0; padding: 0; line-height: 5px;"><strong>JAKARTA</strong> \u2013 Aplikasi penyedia layanan streaming TV dan Video on Demand (VOD) MNC Now kian memberikan ragam konten pilihan bagi para pengguna secara Gratis Selamanya.<br/>Berhasil meraup sebanyak 2,8 juta pengguna baru dalam kurun waktu yang sangat singkat, MNC Now kian memberikan pelayanan terbaik bagi para penggunanya mulai dari tambahan konten-konten pilihan dan penawaran yang menarik untuk dinikmati melalui perangkat smartphone dan tablet, dimana saja dan kapan saja.</p><p style="margin: 0; padding: 0; line-height: 5px;">Beberapa konten fresh tersebut diantaranya film \u20183 Dara 2\u2019, \u2018Rompis\u2019, \u2018Koki-Koki Cilik\u2019 yang merupakan produksi MNC Pictures dan baru rilis di tahun 2018 di bioskop-bioskop Tanah Air kini hadir secara eksklusif di MNC Now.<br/>Ada pula konten video pendek \u2018Popular\u2019 produksi Papilon yang membahas seputar topik menarik untuk pria dewasa dan dibintangi model cantik dan sexy, serta kumpulan video kompetisi game super seru khusus bagi penggemar e-sport. Ribuan jam film dan serial TV lainnya juga hadir secara eksklusif dan gratis di aplikasi MNC Now.</p><p style="margin: 0; padding: 0; line-height: 5px;">Tidak hanya itu, MNC Now juga merupakan aplikasi dunia olahraga dan hiburan terlengkap yang menyajikan channel TV lokal terlengkap, dengan tambahan channel internasional serta premium.<br/>Khusus untuk pelanggan MNC Vision dan MNC Play, dapat melakukan \u2018Connect\u2019 dengan memasukkan nomor ID pelanggan dan tanggal lahir agar dapat menonton lebih dari 130* channel lokal & premium favorit sesuai paket berlangganannya di aplikasi MNC Now. Fitur \u2018Connect\u2019 ini juga dapat dinikmati hingga 5 perangkat yang berbeda.</p><p style="margin: 0; padding: 0; line-height: 5px;">Semakin melengkapi kebutuhan para pengguna yang memiliki kesibukan dan mobilitas yang tinggi, MNC Now juga memiliki fitur \u2018Catch Up TV\u2019 yang memungkinkan untuk memutar kembali program TV terlewat hingga 7 hari kebelakang.<br/>Tidak hanya itu, MNC Now juga memberikan apresiasi kepada pengguna setia MNC Now dengan menyelenggarakan undian dan kuis berhadiah. Sejak Februari 2019 lalu, MNC Now kembali mengadakan Undian Gratis Berhadiah \u2018MaMen (Masuk Menang) 2\u2019 dengan total hadiah sebanyak 260 unit HP Samsung J6+ dan 4 unit Samsung Note 9 yang akan diundi sampai dengan 20 Agustus 2019.</p><p style="margin: 0; padding: 0; line-height: 5px;">Cara mengikutinya sangat mudah, peserta hanya tinggal mengunduh aplikasi MNC Now di Google Play/App Store lalu mendaftarkan alamat emailnya. Pengumuman 10 unit Samsung J6+ akan diumumkan setiap minggu sementara hadiah 2 unit Samsung Note 9 diumumkan setiap 3 bulan sekali.<br/>Selain Undian \u2018MaMen 2\u2019, MNC Now juga membagikan 15 voucher pulsa bernilai Rp. 25.000,- setiap Senin - Jumat melalui Kuis \u2018Watch & Win\u2019. Peserta hanya tinggal menunggu push notification dari aplikasi MNC Now untuk dapat mengetahui tentang informasi film yang akan disertakan sebagai kuis. Setelah itu peserta tinggal menunggu pertanyaan yang tertera di sela-sela film yang ditonton, lalu menjawabnya di menu \u2018Watch & Win\u2019 yang terdapat di pilihan menu pojok kiri atas aplikasi MNC Now.</p><iframe src="https://www.youtube.com/embed/Atqnv7dabCM"></iframe><p style="margin: 0; padding: 0; line-height: 5px;">Untuk informasi lebih lanjut, silakan kunjungi akun sosial media resmi MNC Now di (Facebook/Twitter/Instagram) di @mncnowid.<br/><br/>Sumber : <a href=\'https://techno.okezone.com/read/2019/06/26/207/2071153/mnc-now-tawarkan-channel-tv-lokal-film-dan-serial-tv-gratis-selamanya\'>techno.okezone.com</a></p>',"urlphoto","images/img_posting_20190704_035.jpg","tglposting","26 Jun 2019  -  Pukul 15:03",t,s,"author_urlphoto",r],m,m),P.h(["id","2","title","Perindo: Kapasitas Capim KPK Harus Kuasai Persoalan Hukum","news",'<p style="margin: 0; padding: 0; line-height: 5px;"><strong>JAKARTA</strong> \u2013 Ketua DPW Partai Perindo Sulawesi Selatan, Sanusi Ramadhan mengatakan keseriusan pemerintah dalam membentuk tim panitia seleksi calon pimpinan (Pansel Capim) KPK menjadi bukti dan komitmen Presiden Joko Widodo dalam memberantas kejahatan korupsi di Tanah Air.<br/>Menurutnya, ada sejumlah kriteria yang patut dimiliki dan dipertimbangkan tim pansel dalam menentukan calon pimpinan KPK untuk periode 2019-2024 mendatang.</p><p style="margin: 0; padding: 0; line-height: 5px;">Di antaranya, memiliki latar belakang yang bersih dari sanksi hukum maupun pelanggaran etik di masa lalu.<br/>\u201cSelain kapasitas yang terpenting adalah komitmen dan keberanian pimpinan KPK dalam memberantas korupsi,\u201d ujar Sanusi saat dihubungi Senin, (17/6/2019).<br/>Sebagai institusi yang dipercaya masyarakat, KPK tidak boleh lemah dalam upaya pemberantasan korupsi yang mungkin bersarang di berbagai lembaga pemerintahan.<br/>Karenanya, pimpinan lembaga antirasuah harus memiliki integritas, keadilan dan profesionalisme dalam menjalankan tugasnya.</p><p style="margin: 0; padding: 0; line-height: 5px;">Selain itu, Sanusi mengatakan komisioner KPK wajib memiliki pengetahuan mendalam terkait aturan serta hukum yang tepat untuk menjerat pelaku kejahatan korupsi.<br/>Sehingga, KPK tidak salah langkah dalam menentukan keberlanjutan perkara korupsi.<br/>\u201cCalon pimpinan KPK juga harus menguasasi persoalan hukum itulah salah satu kapasitas yang harus dimiliki,\u201d katanya.<br/>Sementara itu, pagi tadi Presiden Joko Widodo sudah bertemu dengan Tim Pansel Capim KPK di Istana Merdeka, Jakarta, Senin (176/2019).</p><p style="margin: 0; padding: 0;">Dalam pertemuan itu, sembilan anggota pansel mendapatkan mandat untuk bekerja maksimal dalam mendapatkan pimpinan KPK yang terbaik periode 2019-2024.<br/>Dari hasil pertemuan tersebut, Presiden Jokowi menyampaikan kriteria yang harus dimiliki oleh pimpinan KPK ke depan yakni managerial skill yang sangat kuat.<br/>Artinya, pimpinan KPK tidak hanya memerlukan kemampuan investigatif saja. Namun juga kemampuan manejerial untuk mengatur tata kelola institusi.</p>',"urlphoto","images/img_posting_20190704_036.jpg","tglposting","17 Jun 2019  -  Pukul 22:34",t,s,"author_urlphoto",r],m,m),P.h(["id","3","title","Libatkan LPSK di MK, BPN Terlalu Mendramatisir","news",'<p style="margin: 0; padding: 0; line-height: 5px;"><strong>JAKARTA</strong> \u2013 Rencana BPN Prabowo-Sandi melibatkan Lembaga Perlindungan Saksi dan Korban (LPSK) dinilai terlalu didramatisir. TKN Jokowi-Ma\u2019ruf menganggap kondisi tersebut bisa menimbulkan ketidaknyamanan saksi.<br/>Wakil Ketua TKN Jokowi-Ma\u2019ruf, Ahmad Rafiq mengatakan, meski permohonan melindungi para saksi sekalipun dijamin oleh undang-undang namun permohonan ini terlalu dramatis dan terkesan ada persoalan yang membahayakan.</p><p style="margin: 0; padding: 0; line-height: 5px;">Sekjen Partai Perindo ini mengungkapkan, tidak ada pengalaman saksi mendapat intimidasi dalam memberikan keterangan di setiap pemilu dari tahun ke tahun. Dia mengatakan, situasi yang terjadi saat ini juga tidak terlihat ada nuansa panas apalagi membahayakan nyawa siapapun. \u201cSemua berjalan aman-aman saja,\u201d kata Rafiq lagi.<br/>\u201cSaya jadi ingin bertanya, yang menciptakan rasa tidak aman itu siapa? Jangan-jangan dibuat sendiri,\u201d tambahnya.</p><p style="margin: 0; padding: 0; line-height: 5px;">Sekretaris Jendral PKPI, Verry Surya Hendrawan menentang permintaan perlindungan saksi jika dilandasi dengan alasan yang negatif.<br/>Dia mengatakan, perlindungan saksi lebih baik tidak diberikan jika hal itu dilakukan guna memperlihatkan seolah-olah persidangan tidak aman dan aparat gagal memberikan jaminan keamanan bagi masyarakat.</p><p style="margin: 0; padding: 0; line-height: 5px;">Menurut Verry, alasan tersebut akan membuat permintaan perlindungan saksi dan ahli menjadi hal yang bersifat kontraproduktif. Permintaan dengan alasan yang tidak baik itu juga cenderung tendesius.<br/>\u201cSeolah-olah bahwa memberikan keterangan yang jujur di persidangan menjadi hal yang berbahaya dan rawan. Kesan seperti itu harus sama-sama kita hindari,\u201d katanya.</p><p style="margin: 0; padding: 0; line-height: 5px;">Sebelumnya, permintaan perlindungan saksi dan ahli diminta Ketua Tim Kuasa Hukum BPN Bambang Widjojanto (BW) kepada MK. Permohonan itu diajukan karena ada kekhawatiran akan adanya intervensi dari calon presiden (capres) pejawat.<br/>BW berpendapat, petahana mempunyai potensi menggunakan seluruh sumber dayanya. Alasan lain yang menjadi pertimbangan dimintanya perlindungan saksi oleh BW menyusul adanya potensi proses pemeriksaan di MK tidak bisa seluas-luasnya memberi akses keadilan.</p><p style="margin: 0; padding: 0; line-height: 5px;">Sementara, Jubir BPN Prabowo-Sandi, Andre Rosiade mengatakan, pihaknya akan menyurati MK terkait saksi.<br/>\u201cKeterlibatan LPSK ini diperlukan untuk menjamin rasa aman bagi saksi dan ahli yang dihadirkan pasangan capres dan cawapres 02 untuk kepentingan pembuktian pada persidangan sengketa Pemilu 2019 di MK,\u201d kata Andre.</p><p style="margin: 0; padding: 0; line-height: 5px;">Andre mengatakan, setidaknya hingga saat ini sudah ada lebih kurang 30 saksi yang bersedia membongkar bukti kecurangan Pilpres 2019. Namun, dia mengatakan, mereka yang berasal dari sejumlah daerah di tanah air ini meminta jaminan keselamatan sebelum, saat, dan sesudah datang ke MK untuk bersaksi.<br/>Politikus Gerindra ini mengatakan, demi keselamatan saat memberikan keterangan nanti, saksi yang dihadirkan dapat menggunakan sejumlah metode LPSK.</p><p style="margin: 0; padding: 0; line-height: 5px;">Misalnya, bersaksi dari jarak jauh menggunakan teleconference, berbicara di ruangan bertirai hitam untuk menyamarkan lokasi saksi, hingga menyamarkan sejumlah informasi tentang saksi demi keselamatan pribadi.<br/>Andre mengatakan, tidak hanya bagi saksi yang akan memberikan keterangan dalam persidangan, tim hukum Prabowo-Sandi juga mendorong agar LPSK turut melindungi dan menjamin keamanan seluruh hakim MK.<br/>Dia mengatakan hal itu agar mereka terlepas dari bentuk intervensi dan ancaman dalam memutuskan sengketa pilpres.<br/><br/>Sumber : <a href=\'rmco.id\'>rmco.id</a></p>',"urlphoto","images/img_posting_20190704_037.jpg","tglposting","17 Jun 2019  -  Pukul 11:00",t,s,"author_urlphoto",r],m,m),P.h(["id","4","title","TKN Minta BPN Tidak Mendramatisasi Ancaman terhadap Saksi","news",'<p style="margin: 0; padding: 0; line-height: 5px;"><strong>JAKARTA</strong> \u2013 Tim Kampanye Nasional (TKN) Joko Widodo (Jokowi) \u2013 Ma\u2019ruf Amin meminta Badan Pemenangan Nasional (BPN) Prabowo \u2013 Sandiaga tidak mendramatisir ancaman terhadap saksi. Sebab, saksi dilindungi dan dijamin Undang-Undang (UU).<br/>Demikian diungkapkan Wakil Sekretaris TKN Jokowi-Ma\u2019ruf Amin, Ahmad Rofiq setelah BPN meminta perlindungan 30 saksi yang akan hadir ke Mahkamah Konstitusi (MK) kepada Lembaga Perlindungan Saksi dan Korban (LPSK).</p><p style="margin: 0; padding: 0; line-height: 5px;">\u201cPerlindungan terhadap saksi itu menjadi hak dan dijamin oleh undang-undang. Silahkan saja bila diperlukan. Yang penting jangan didramatisasi kalau ini ada ancaman, suasana mencekam,\u201d kata Rofiq kepada Okezone, Minggu (16/6/2019).<br/>Menurut Rofiq perlindungan terhadap 30 saksi yang akan dihadirkan BPN ke MK tidak terlalu diperlukan. Sebab, TKN melihat tidak ada ancaman dan teror terhadap BPN hingga saat ini.</p><p style="margin: 0; padding: 0; line-height: 5px;">\u201cSaya lihat perlindungan itu tidak begitu diperlukan mengingat ancaman, teror dan lain-lain tidak ada sama sekali. Saya lihat semua kondusif dan saling menghormati satu sama lain. Tidak ada tekanan dan ancaman,\u201d terangnya.<br/>Sebelumnya, tim hukum BPN menyebut ada 30 saksi yang akan dihadirkan dalam sidang Perselisihan Hasil Pemilihan Umum (PHPU). BPN meminta LPSK untuk menjamin keselamatan 30 saksinya tersebut.<br/><br/>Sumber : <a href=\'okezone.com\'>okezone.com</a></p>',"urlphoto","images/img_posting_20190704_038.jpg","tglposting","16 Jun 2019  -  Pukul 12:52",t,s,"author_urlphoto",r],m,m),P.h(["id","5","title","Kubu Prabowo Dinilai Berkhayal di Sidang Mahkamah Konstitusi","news",'<p style="margin: 0; padding: 0; line-height: 5px;"><strong>JAKARTA</strong> \u2013 Juru bicara Tim Kampanye Nasional (TKN) Joko Widodo-Ma\u2019ruf Amin Arya Sinulingga menilai bukti yang dilampirkan kubu Prabowo Subianto-Sandiaga Uno di Mahkamah Konstitusi (MK) cukup aneh. Semua tudingan yang disampaikan kubu pasangan capres dan cawapres 02 dinilai khayalan.<br/>\u201cDari persidangan terlihat bahwa 02 itu banyak membawa asumsi-asumsi. Istilahnya praduga tak bersalah,\u201d kata Arya kepada Medcom.id, Minggu, 16 Juni 2019.</p><p style="margin: 0; padding: 0; line-height: 5px;">Arya mencontohkan tudingan aparatur sipil negara (ASN) yang tak netral di Pilpres 2019. Kubu Prabowo-Sandiaga juga menuding Badan Intelijen Negara (BIN) berpihak karena menghadiri ulang tahun PDI Perjuangan.<br/>Ia menilai tudingan itu tak dibarengi bukti autentik. Sehingga, tudingan itu hanya isapan jempol belaka. \u201cIni kan cuma asumsi, praduga tak bersalah,\u201d ujar Arya.</p><p style="margin: 0; padding: 0; line-height: 5px;">Politikus Partai Perindo itu menilai bukti yang dihadirkan kubu Prabowo-Sandiaga lemah. Tuduhan kecurangan terstruktur, sistematis, dan masif dari pasangan nomor urut 02 itu dinilai sebagai khayalan.<br/>Arya juga menyebut deretan tuduhan yang disampaikan saat sidang perdana di Mahkamah Konstitusi tak berdasar. \u201cBanyak asumsi yang mereka bangun untuk argumen mereka. Jadi bukan bukti bahwa tuduhan mereka itu benar, tapi semuanya praduga tak bersalah. Ini kan aneh, bukan bukti bahwa adanya kecurangan\u201d tegas Arya.<br/><br/>Sumber : <a href=\'medcom.id\'>medcom.id</a></p>',"urlphoto","images/img_posting_20190704_039.jpg","tglposting","17 Jun 2019  -  Pukul 10:55",t,s,"author_urlphoto",r],m,m),P.h(["id","6","title","Sengketa Pilpres Digelar di MK, Perindo Harap Tak Ada Gangguan dari Pihak Luar","news",'<p style="margin: 0; padding: 0; line-height: 5px;"><strong>JAKARTA</strong> \u2013 Proses sidang pendahuluan Perselisihan Hasil Pemilihan Umum (PHPU) Presiden 2019 telah berlangsung di gedung Mahkamah Konstitusi, Jumat (14/6/2019).<br/>Adapun agenda sidang perdana hari ini, yakni pemeriksaan terhadap kejelasan dari pemohon sengketa Pilpres yang diajukan pasangan capres-cawapres Prabowo Subianto-Sandiaga Uno.</p><p style="margin: 0; padding: 0; line-height: 5px;">Artinya, pemohon diberikan kesempatan untuk menyampaikan pokok-pokok permohonan di hadapan pihak termohon yaitu KPU dan pihak terkait, pasangan capres-cawapres Joko Widodo-KH Ma\u2019ruf Amin, dan pihak lainnya.<br/>\u201cBiasanya sidang perdana hanya memastikan legal standing dan kelengkapan materi gugatan. Sekiranya belum lengkap diberikan kesempatan untuk melengkapinya dalam waktu tertentu,\u201d ujar Ketua Bidang Keagamaan DPP Partai Perindo Abdul Khaliq Ahmad, Jumat (14/6/2019).</p><p style="margin: 0; padding: 0; line-height: 5px;">Khaliq berharap disidang yang tengah digelar hari ini bisa berjalan dengan baik tanpa adanya gangguan dari pihak luar.<br/>\u201cJadi kita harapkan sidang berkelas negarawan tanpa ada kericuhan dan intervensi dari pihak lain. Jadilah pendukung paslon yang cerdas dan santun serta berkarakter,\u201d katanya.</p><p style="margin: 0; padding: 0; line-height: 5px;">Ia juga mengimbau agar para pendukung dari masing-masing calon untuk tidak ikut hadir ke persidangan MK.<br/>Hal ini bertujuan untuk menjaga agar persidangan sengketa pemilu berjalan kondusif. Publik diminta untuk memantau jalannya persidangan melalui televisi.</p><p style="margin: 0; padding: 0; line-height: 5px;">\u201cJadi bagi para pendukung paslon tak perlulah ikut hadir di persidangan. Lewat media massa sudah cukup. Jika perlu melalui streaming yang disiapkan MK,\u201d katanya.<br/>Lebih lanjut, Khaliq kembali mengingatkan kepada publik untuk tidak meragukan kredibilitas serta independensi para hakim MK dalam mengatasi sidang sengketa hasil Pilpres 2019 tersebut.</p><p style="margin: 0; padding: 0; line-height: 5px;">\u201cPercayakan segala proses peradilan kepada hakim-hakim MK yang credible dan profesional serta tim pengacara yang mewakili masing-masing paslon,\u201d katanya.<br/>Sejak Jumat (14/6) pagi, MK mengelar sidang perdana gugatan Pilpres 2019. Dalam sidang tersebut dihadiri tim kuasa hukum baik dari kubu Prabowo-Sandi selaku pengugat, KPU selaku tergugat dan kuasa hukum Jokowi-Ma\u2019ruf Amin maupun Bawaslu selaku pihak terkait.<br/>Sidang akan dilanjutkan pada Selasa, 18 Juni, dengan agenda mendengarkan tanggapan dari KPU.</p>',"urlphoto","images/img_posting_20190704_040.jpg","tglposting","14 Jun 2019  -  Pukul 19:30",t,s,"author_urlphoto",r],m,m),P.h(["id","7","title","Pemuda Perindo Ingatkan Pejabat Terima Gratifikasi Lapor ke KPK","news",'<p style="margin: 0; padding: 0; line-height: 5px;"><strong>JAKARTA</strong> \u2013 Ketua DPW Pemuda Perindo Banten Tulus Setyanto mengatakan penyelenggara negara yang melakukan gratifikasi atau menerima \u2018hadiah\u2019 bisa diindikasikan sebagai kejahatan korupsi jika tidak dilaporkan ke Komisi Pemberantasan Korupsi (KPK).<br/>\u201cUntuk pejabat negara, ASN, BUMN dan jajarannya aturannya itu sudah jelas terkait pelarangan pemberian gratifikasi, cuma praktiknya masih terjadi di momen lebaran seperti ini,\u201d ujarnya saat dihubungi, Jumat (14/6/2019).</p><p style="margin: 0; padding: 0; line-height: 5px;">Tulus mengimbau agar pejabat negara yang menerima \u2018hadiah\u2019 terkait perayaan Idul Fitri 2019 untuk segera melapor ke KPK. Agar status barang gratifikasi tersebut dapat ditetapkan menjadi milik negara, milik penerima atau ketentuan lain sesuai dengan aturan hukum tersebut.<br/>Di moment lebaran ini, terkadang gratifikasi bentuknya bermacam-macam tetapi tidak pantas pejabat menerimanya walaupun dengan bahasa berbagi karena hal tersebut jika dilakukan bisa menjadi pintu masuk korupsi.</p><p style="margin: 0; padding: 0; line-height: 5px;">\u201cTetapi apabila sudah terlanjur menerima supaya segera melapor ke KPK, kan ada waktu untuk melapor 30 hari dari semenjak menerima gratifikasi supaya tidak terkena masalah,\u201d katanya.<br/>Apabila aturan tersebut dapat diterapkan maka upaya pencegahan korupsi di lingkungan pemerintah daerah terkait penerimaan gratifikasi oleh pejabat publik dapat dihindari sedini mungkin.</p><p style="margin: 0; padding: 0; line-height: 5px;">\u201cKalau ini dijalankan dan dipatuhi akan terwujud aparatur negara yang bersih dan bebas dari KKN,\u201d katanya.<br/>Sebelumnya, KPK telah mengeluarkan Surat Edaran (SE) KPK tentang Imbauan Pencegahan Gratifikasi Terkait Hari Raya Keagamaan yang ditujukan kepada pimpinan instansi, kementerian, lembaga, organisasi, pemerintah daerah, BUMN dan BUMD pada 8 Mei 2019 lalu.<br/>Hingga hari ini, KPK telah menerima 161 laporan gratifikasi terkait perayaan Lebaran 2019 yang diberikan kepada sejumlah pejabat negara atau pegawai negeri. Jumlah ini bertambah 67 laporan dari sebelumnya yang hanya 94 laporan pada 10 Juni 2019.</p>',"urlphoto","images/img_posting_20190704_041.jpg","tglposting","14 Jun 2019  -  Pukul 19:26",t,s,"author_urlphoto",r],m,m),P.h(["id","8","title","Ini Latar Belakang Calon Menteri Jokowi di Kabinet Kerja Jilid Dua Menurut TKN","news",'<p style="margin: 0; padding: 0; line-height: 5px;"><strong>JAKARTA</strong> \u2013 Juru Bicara Tim Kampanye Nasional Jokowi-Ma\u2019ruf Arya Sinulingga meyakini Presiden Joko Widodo alias Jokowi akan menarik orang-orang profesional dalam Kabinet Kerja jilid kedua. Menurut Arya, kriteria tersebut yang dicari Jokowi untuk membantunya pada periode kedua.<br/>\u201cYang penting profesional pasti,\u201d ucapnya kepada wartawan, Kamis (13/6).</p><p style="margin: 0; padding: 0; line-height: 5px;">Profesional yang dimaksud, menurut Arya, tidak mendikotomi antara profesional dengan kader partai politik. Kata dia, dari kalangan partai pun ada orang profesional.<br/>\u201cProfesional itu artinya dari parpol banyak profesional juga di bidangnya. Orang parpol banyak yang profesional. Gitu loh, jadi tidak ada masalah,\u201d kata politikus Perindo itu.</p><p style="margin: 0; padding: 0; line-height: 5px;">Arya enggan membahas nama-nama calon menteri yang tengah dipertimbangkan Jokowi. Menurutnya, nama itu hanya diketahui Jokowi seorang.<br/>\u201cPak Jokowi pasti udah lah, sudah ada. Sudah dikantongi, beliau mempertimbangkan banyak hal. Itu aja sih,\u201d ucapnya.</p><p style="margin: 0; padding: 0; line-height: 5px;">Sebelumnya, Presiden Joko Widodo membeberkan Kabinet Kerja Jilid II ke depan akan fokus pada tiga hal. Yaitu penguatan fondasi pada penyelesaian proyek infrastruktur, pembangunan sumber daya manusia, dan reformasi birokrasi.<br/>Presiden Joko Widodo dalam wawancara khusus dengan Tim LKBN ANTARA di Istana Merdeka Jakarta, Rabu (12/6). Dia mengatakan Indonesia sebagai negara besar memerlukan fondasi-fondasi yang kuat agar bisa bersaing dengan negara-negara lain.</p><p style="margin: 0; padding: 0; line-height: 5px;">\u201cFondasi itu diperlukan dalam rangka kompetisi kita dengan negara-negara lain dan saya melihat memang kenapa kita lima tahun ke belakang kita fokus pada infrastruktur karena stok infrastruktur kita, kita lihat memang masuk baru pada angka baru 37 persen,\u201d kata Jokowi.<br/>Sumber : <a href=\'merdeka.com\'>merdeka.com</a></p>',"urlphoto","images/img_posting_20190704_042.jpg","tglposting","14 Jun 2019  -  Pukul 11:42",t,s,"author_urlphoto",r],m,m),P.h(["id","9","title","TKN Yakin Jokowi Ajak Profesional Masuk Kabinet Kerja Jilid II","news",'<p style="margin: 0; padding: 0; line-height: 5px;">JAKARTA \u2013 Juru Bicara Tim Kampanye Nasional Jokowi-Ma\u2019ruf, Arya Sinulingga meyakini bahwa Presiden Joko Widodo atau Jokowi akan menarik orang-orang profesional dalam Kabinet Kerja Jilid II. Menurut Arya, kriteria tersebut yang dicari Jokowi untuk membantunya pada periode kedua.<br/>\u201cYang penting profesional pasti,\u201d ucapnya kepada wartawan, Kamis (13/6/2019).</p><p style="margin: 0; padding: 0; line-height: 5px;">Profesional yang dimaksud, menurut Arya, tidak medikotomi antara profesional dengan kader partai politik. Kata dia, dari kalangan partai pun ada orang profesional.<br/>\u201cProfesional itu artinya dari parpol banyak profesional juga di bidangnya. Orang parpol banyak yang profesional. Gitu loh, jadi tidak ada masalah,\u201d kata politikus Perindo itu.</p><p style="margin: 0; padding: 0; line-height: 5px;">Arya enggan membahas nama-nama calon menteri yang tengah dipertimbangkan Jokowi. Menurutnya, nama itu hanya diketahui Jokowi seorang.<br/>\u201cPak Jokowi pasti udah lah, sudah ada, sudah dikantongi. Beliau mempertimbangkan banyak hal. Itu aja sih,\u201d ucapnya.</p><p style="margin: 0; padding: 0; line-height: 5px;">Sebelumnya, Presiden Jokowi membeberkan Kabinet Kerja Jilid II ke depan akan fokus pada tiga hal. Yaitu penguatan fondasi pada penyelesaian proyek infrastruktur, pembangunan sumber daya manusia, dan reformasi birokrasi.<br/>Dalam wawancara khusus dengan Tim LKBN ANTARA di Istana Merdeka Jakarta, Rabu, 12 Juni kemarin, Jokowi mengatakan Indonesia sebagai negara besar memerlukan fondasi-fondasi yang kuat agar bisa bersaing dengan negara-negara lain.</p><p style="margin: 0; padding: 0; line-height: 5px;">\u201cFondasi itu diperlukan dalam rangka kompetisi kita dengan negara-negara lain dan saya melihat memang kenapa kita lima tahun ke belakang kita fokus pada infrastruktur karena stok infrastruktur kita, kita lihat memang masuk baru pada angka baru 37 persen,\u201d ungkapnya.<br/><br/>Sumber : <a href=\'liputan6.com\'>liputan6.com</a></p>',"urlphoto","images/img_posting_20190704_043.jpg","tglposting","14 Jun 2019  -  Pukul 11:34",t,s,"author_urlphoto",r],m,m),P.h(["id","10","title","4 Visi Ibu Kota Baru, Jadi Identitas Bangsa hingga Internet Sangat Cepat","news",'<p style="margin: 0; padding: 0; line-height: 5px;">JAKARTA - Presiden Joko Widodo (Jokowi) memutuskan ibu kota pindah ke Kalimantan. Dalam bulan ini, orang nomor satu di Indonesia akan mengumumkan lokasi ibu kota yang baru.<br/><br/>Founder Bhinneka Institute Arya Sinulingga buka suara soal rencana Presiden Jokowi mengenai pemindahan ibu kota ke wilayah Kalimantan.</p><p style="margin: 0; padding: 0; line-height: 5px;">Keputusan besar pemindahan ibu kota Indonesia dari Jakarta ke salah satu provinsi di pulau Kalimantan ini setidaknya didasari empat visi mendasar yang akan berdampak besar.<br/><br/>Seperti dikutip dari channel YouTube APA MAUNYA JOKOWI, Jakarta, Sabtu (3/8/2019), Arya memaparkan empat visi Jokowi. "Jelas ya kemarin pak Jokowi bilang soal pemindahan ibu kota baru itu, Sebenarnya ada 4 visi Pak Jokowi untuk ibu kota baru.", kata Arya.</p><p style="margin: 0; padding: 0; line-height: 5px;">Pertama adalah ibu kota baru ini akan jadi identitas bangsa Indonesia.<br/>Kedua, kota baru itu akan menjadi kota yang smart atau pintar.<br/>Ketiga, kota baru nanti juga akan menjadi kota yang green atau hijau.<br/>Keempat, akan menjadikan kota yang sustainable, atau berkelanjutan yang tidak akan berhenti jika sudah jadi besar.<br/><br/>Sumber : <a href=\'https://economy.okezone.com/read/2019/08/03/470/2087204/4-visi-ibu-kota-baru-jadi-identitas-bangsa-hingga-internet-sangat-cepat\'>economy.okezone.com</a></p>',"urlphoto","https://img-k.okeinfo.net/content/2019/08/03/470/2087204/4-visi-ibu-kota-baru-jadi-identitas-bangsa-hingga-internet-sangat-cepat-POfVk8XSv0.png","tglposting","03 Agt 2019  -  Pukul 09:55",t,"Yohana Artha Uly - Redaksi Okezone","author_urlphoto","https://pbs.twimg.com/profile_images/1080335112913350657/_ntjFa2K_400x400.jpg"],m,m),P.h(["id","11","title","Demo - Aplikasi Partai Perindo (Android & iOS) made with Flutter","news",'<p style="margin: 0; padding: 0; line-height: 5px;">Wajah baru situs Partai Perindo, kini makin milenial. Adapun teknologi yang digunakan yaitu Dart. Teknologi yang dikembangkan oleh Tim IT-nya Pak Irvan Nasrun ini, mengungguli deretan teknologi yang dikembangkan oleh developer-developer lainnya di Indonesia sampai di Asia Tenggara.<br/>Berbekal tim inti sebanyak 3 orang yaitu Fadhli (Head & Tech. Lead for Web & Mobile Development), Lovi (GoLang Developer) dan Nabil (Quality Control). Mereka berhasil mengembangkan teknologi dari Google ini ke level production dengan menyambet sekaligus Apps Android, Apps iOS, Web, Desktop App untuk Mac-Linux-Windows, IoT layar besar seperti video tron.</p><p style="margin: 0; padding: 0; line-height: 5px;">Semoga ke depan mereka dapat mengemban teknologi di Indonesia semakin maju.<br/><br/>Sumber : <a href=\'https://okerpl.blogspot.com/2018/12/demo-aplikasi-partai-perindo-android_6.html\'>okerpl.blogspot.com</a></p>',"urlphoto",q,"tglposting",p,t,o,"author_urlphoto",n],m,m),P.h(["id","12","title","Announce The General Availability of Flutter 1.7 by Google","news",'<p style="margin: 0; padding: 0; line-height: 5px;">Today we\u2019re pleased to announce the general availability of <strong>Flutter 1.7</strong>, a smaller release after the major feature announcements at Google I/O. Flutter 1.7 contains support for AndroidX and for updated Play Store requirements, a number of new and enhanced components, and bug fixes to customer-reported issues.</p><p style="margin: 0; padding: 0; line-height: 5px;">If you already have Flutter on your system and you\u2019re on the default stable channel, you can upgrade to version 1.7 by running flutter upgrade from the command line. The updated release is also included in a new installation of Flutter.</p><p style="margin: 0; padding: 0; line-height: 5px;"><strong>AndroidX Support for New Apps</strong><br/>AndroidX is a new open source support library from the Jetpack team that helps Android apps stay updated with the latest components without sacrificing backward compatibility. Now that AndroidX is itself stable and many Flutter packages have been updated to support it, Flutter supports creating new Flutter projects with AndroidX, which reduces the work needed to integrate with other parts of the Android ecosystem.</p><p style="margin: 0; padding: 0; line-height: 5px;">Source : <a href=\'https://medium.com/flutter/announcing-flutter-1-7-9cab4f34eacf\'>medium.com/flutter</a></p>',"urlphoto",q,"tglposting",p,t,o,"author_urlphoto",n],m,m),P.h(["id","13","title","Flutter for web early adopter program now open","news",'<p style="margin: 0; padding: 0; line-height: 5px;">Our vision for Flutter has always been to provide a fast, productive and open toolkit for creating beautiful user experiences on any platform. We started with mobile, with a toolkit that is already in use for tens of thousands of apps, big and small. At Google I/O this year, we announced the first preview of Flutter support for the web, allowing developers to use the same skills and code to target the web browser, and we\u2019ve seen a lot of interest already. Thank you to the thousands of you who are already experimenting with Flutter on the web and giving us your feedback.</p><p style="margin: 0; padding: 0; line-height: 5px;">We\u2019re excited to announce that we are moving into a new phase of development as we get closer to a production-quality release of our web support. Today, we are opening an exclusive program for companies, design agencies and startups who are ready to build in earnest on Flutter for the web. We have a limited number of slots available by application to those who are ready to engage with us directly on a first wave of production Flutter web applications.</p><p style="margin: 0; padding: 0; line-height: 5px;">Accepted participants will receive priority support and an opportunity to highlight their projects in Google / Flutter media and events.</p><p style="margin: 0; padding: 0; line-height: 5px;">Source : <a href=\'https://medium.com/flutter/flutter-for-web-early-adopter-program-now-open-9f1fb146e4c4\'>medium.com/flutter</a></p>',"urlphoto","https://miro.medium.com/max/1000/1*HcggEjhP_Li6Tt7KIzB10g.png","tglposting","13 Agt 2019  -  Pukul 08:00",t,"Kevin Moore - Medium.com","author_urlphoto","https://miro.medium.com/fit/c/48/48/1*iUVmcyWC2Pj7ERaoSF-Onw.jpeg"],m,m)],[[P.N,P.j,P.j]])})
